FormattingHTML formattingIn some cases you might want to rendered your translation as an HTML message and not a static string.var locales = {
  en: {
    message: {
      hello: 'hello  world'
    }
  }
}
Template the following (notice the tripple brackets):{{{ $t('message.hello') }}}
Output the following (instead of the message pre formatted)hello
 exists but is rendered as html and not a string-->
world
Named formattingLocale the following:var locales = {
  en: {
    message: {
      hello: '{msg} world'
    }
  }
}
Template the following:{{ $t('message.hello', { msg: "hello"}) }}
Output the following:hello world
List formattingLocale the following:var locales = {
  en: {
    message: {
      hello: '{0} world'
    }
  }
}
Template the following:{{ $t('message.hello', ["hello"]) }}
Output the following:hello world
Support ruby on rails i18n formatLocale the following:var locales = {
  en: {
    message: {
      hello: '%{msg} world'
    }
  }
}
Template the following:{{ $t('message.hello', { msg: "hello"}) }}
Output the following:hello world

